import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Tile} from "./Tile";

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <Tile type={"A"} />
          <Tile type={"B"} />
          <Tile type={"C"} />
          <Tile type={"l2"} />
          <Tile type={"l3"} />
          <Tile type={"w2"} />
          <Tile type={"w3"} />
      </header>
    </div>
  );
}

export default App;
